register.text:
// Fetch current live course info
        model?.run {
            getLiveCourseInfo().subscribeOn(Schedulers.io())
                    .retry(DEFAULT_RETRY_TIMES)
                    .observeOn(AndroidSchedulers.mainThread())
                    .autoDispose(this@LivePresenter, PresenterLifecycle.Event.DETACH)
                    .subscribeBy(
                            onError = { Timber.e("Get live course info error: $it") },
                            onNext = {
                                Timber.d("Get live course info: $it")
                                it?.run {
                                    view?.onLiveDataChanged(F_tname, F_avatar, F_name)
                                    view?.onPresentCourseQrCode(F_subject)
                                }
                            }
                    )

try {
            mediaPlayer.reset()
        } catch (e: IllegalStateException) {
            e.printStackTrace()
        }
        isPrepared = false
